import React, {Fragment} from 'react';

class Aside extends React.Component {
    render() {
        return(
            <Fragment>
                <div className='aside'>
                    <div className='user-info'>
                        <img src="https://wallpapercave.com/wp/5vKVIBr.jpg" alt="img-dragon-nest-priest"/>
                    </div>
                </div>
            </Fragment>
        );
    }
}

export default Aside;
